import React from 'react';
import { CoinName, CoinDisplayDiv, CoinImage, CoinRank, HourChange, CoinPrice, DayChange, WeekChange, VolumeMarket, CirculatingSupply, Last7d, ImgName } from './styles';

export default function CoinTableData(props) {
    return(
        <CoinDisplayDiv>
            <Rank>{props.market_cap_rank}</Rank>
            <ImgName>
                <Image src={props.image}></Image>
                <Name>{props.name}</Name>        
            </ImgName>

            <Price>{props.current_price}</Price>
            <Hour>{props.hourchange.toFixed(2)}</Hour>
            <Day>{props.daychange.toFixed(2)}</Day>
            <Week>{props.weekchange.toFixed(2)}</Week>
            <VolumeMarket></VolumeMarket>
            <CirculatingSupply></CirculatingSupply>
            <Last7d></Last7d>
        </CoinDisplayDiv>
    )
}
